DROP TABLE IF EXISTS `employees`;
CREATE TABLE `employees`  (
  `id` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT 'id karyawan hanya untuk konsumsi komputer dan programmer',
  `employee_code` varchar(20) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `nik` varchar(16) CHARACTER SET latin2 COLLATE latin2_general_ci NULL DEFAULT NULL COMMENT 'nomor induk karyawan',
  `name` varchar(40) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL COMMENT 'nama lengkap karyawan',
  `birth_place` varchar(30) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL COMMENT 'tempat lahir',
  `birth_date` date NULL DEFAULT NULL COMMENT 'tanggal lahir',
  `division` varchar(10) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL COMMENT 'Divisi karyawan bekerja',
  `gender` enum('L','P') CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT 'L' COMMENT 'L laki-laki, P Perempuan',
  `religion` int NULL DEFAULT NULL COMMENT 'agama kepercayaan',
  `education_level` enum('SD','SMP','SMA','DIPLOMA','SARJANA','MASTER','DOKTORAL','PROFESOR','LAIN-LAIN') CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL COMMENT 'Level Pendidikan',
  `address` varchar(255) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL COMMENT 'alamat tempat yang ditinggali',
  `phone_number` varchar(18) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL COMMENT 'nomor telepon seluler',
  `npwp_number` varchar(25) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL COMMENT 'nomor npwp pribadi',
  `email` varchar(45) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `joint_date` date NULL DEFAULT NULL,
  `end_date` date NULL DEFAULT NULL,
  `employee_type` enum('Tetap','Kontrak') CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `job_description` text CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL,
  `status` enum('0','1','D') CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT '1' COMMENT 'status customer aktif atau tidak',
  `created_at` datetime NULL DEFAULT NULL,
  `modified_at` timestamp NULL DEFAULT NULL,
  `created_by` int NULL DEFAULT NULL,
  `modified_by` int NULL DEFAULT NULL,
  `deleted_at` datetime NULL DEFAULT NULL,
  `deleted_by` int NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
