-- ----------------------------
-- View structure for view_check_hscodes
-- ----------------------------
DROP VIEW IF EXISTS `view_check_hscodes`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `view_check_hscodes` AS select `check_hscodes`.`id` AS `id`,`check_hscodes`.`number` AS `number`,`check_hscodes`.`customer_id` AS `customer_id`,`check_hscodes`.`project_name` AS `project_name`,`check_hscodes`.`marketing_id` AS `marketing_id`,`check_hscodes`.`date` AS `date`,`check_hscodes`.`description` AS `description`,`check_hscodes`.`origin_country_id` AS `origin_country_id`,`check_hscodes`.`status` AS `status`,`check_hscodes`.`last_checked_at` AS `last_checked_at`,`check_hscodes`.`last_checked_by` AS `last_checked_by`,`check_hscodes`.`created_at` AS `created_at`,`check_hscodes`.`created_by` AS `created_by`,`customers`.`customer_name` AS `customer_name`,`employees`.`employee_code` AS `employee_code`,`employees`.`name` AS `employee_name`,`check_hscodes`.`revision_count` AS `revision_count`,(select count(`check_hscode_detail`.`id`) from `check_hscode_detail` where (`check_hscode_detail`.`check_hscode_id` = `check_hscodes`.`id`)) AS `qty`,`countries`.`name` AS `country_name`,`countries`.`country_code` AS `country_code`,`check_hscodes`.`modified_at` AS `modified_at`,`check_hscodes`.`modified_by` AS `modified_by`,`check_hscodes`.`old_id` AS `old_id`,`check_hscodes`.`currency` AS `currency` from (((`check_hscodes` left join `customers` on((`check_hscodes`.`customer_id` = `customers`.`id_customer`))) left join `employees` on((`customers`.`sales_id` = `employees`.`id`))) join `countries` on((`check_hscodes`.`origin_country_id` = `countries`.`id`)));

-- ----------------------------
-- View structure for view_custom_clearance
-- ----------------------------
DROP VIEW IF EXISTS `view_custom_clearance`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `view_custom_clearance` AS select `custom_clearance`.`id` AS `id`,`custom_clearance`.`container_id` AS `container_id`,`custom_clearance`.`cost_value` AS `cost_value`,`custom_clearance`.`description` AS `description`,`custom_clearance`.`status` AS `status`,`custom_clearance`.`created_at` AS `created_at`,`custom_clearance`.`created_by` AS `created_by`,`custom_clearance`.`modified_at` AS `modified_at`,`custom_clearance`.`modified_by` AS `modified_by`,`custom_clearance`.`deleted_at` AS `deleted_at`,`custom_clearance`.`deleted_by` AS `deleted_by`,`containers`.`name` AS `container_size` from (`custom_clearance` left join `containers` on((`custom_clearance`.`container_id` = `containers`.`id`)));

-- ----------------------------
-- View structure for view_employees
